  \"quarterly-narrative-report-crescent-lake-refuge-quarter-ending-october-31-1938\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Crescent Lake
  National Wildlife Refuge outlines Refuge accomplishments from  August through October
  of 1938. The report begins by summarizing the weather conditions during this period.
  Wildlife- including migratory birds, big game animals, predators, raptors, and disease-
  is also covered. The Refuge development and maintenance section discusses physical
  developments and plantings. The public relations section of the report describes
  violations. Photographs are attached.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
